import { EngineObject } from "./engine-object";
import { Component } from "./component";
import { SignalDispatcher, SimpleEventDispatcher } from "strongly-typed-events";
import Transform from "./transform";

export class GameObject extends EngineObject{
  protected _type: string = 'GameObject';
  public name: string;
  public transform: Transform;
  private _components: Component[] = [];
  private _onAwake: SignalDispatcher = new SignalDispatcher();
  private _onStart: SignalDispatcher = new SignalDispatcher();
  private _onUpdate: SimpleEventDispatcher<GameObject> = new SimpleEventDispatcher();
  private _onFixedUpdate: SimpleEventDispatcher<GameObject> = new SimpleEventDispatcher();
  private _onDestroy: SimpleEventDispatcher<Component> = new SimpleEventDispatcher();
  
  constructor(name: string, transform?: Transform) {
    super();
    this.name = name;
    this.transform = transform != null ? transform : new Transform(this);
  }

  Awake() {
    super.Awake();
    this._onAwake.dispatch();
  }

  Start() {
    super.Start();
    this._onStart.dispatch();
  }

  Update() {
    super.Update();
    this._onUpdate.dispatch(this);
  }

  FixedUpdate() {
    super.FixedUpdate();
    this._onFixedUpdate.dispatch(this);
  }

  Destroy(object: EngineObject = this) {
    this._onDestroy.dispatch(object as Component);
    this.RemoveAllComponents();
    super.Destroy();
  }

  private RemoveAllComponents() {
    this._components.forEach(component => {
      this._onAwake.unsub(component.eventList.get('Awake') as () => void);
      this._onStart.unsub(component.eventList.get('Start') as () => void);
      this._onUpdate.unsub(component.eventList.get('Update') as () => void);
      this._onFixedUpdate.unsub(component.eventList.get('FixedUpdate') as () => void);
      this._onDestroy.unsub(component.eventList.get('Destroy') as () => void);
    });
  }

  public RemoveComponent(typeName: string) {
    let uncheckedComponent = this.GetComponent(typeName);

    if (uncheckedComponent instanceof Component) {
      let component = uncheckedComponent;
      this._onUpdate.unsub(() => component.Update());
    }
  }

  public AddComponent<T extends Component>(component: T) {
    component.gameObject = this;

    let awakeEvent = () => component.Awake();
    let startEvent = () => component.Start();
    let updateEvent = () => component.Update();
    let fixedUpdateEvent = () => component.FixedUpdate();
    let destroyEvent = () => component.Destroy();
    
    this._onAwake.sub(awakeEvent);
    this._onStart.sub(startEvent);
    this._onUpdate.sub(updateEvent);
    this._onFixedUpdate.sub(fixedUpdateEvent);
    this._onDestroy.sub(destroyEvent);

    component.eventList.set('Awake', awakeEvent);
    component.eventList.set('Start', startEvent);
    component.eventList.set('Update', updateEvent);
    component.eventList.set('FixedUpdate', fixedUpdateEvent);
    component.eventList.set('Destroy', destroyEvent);

    this._components.push(component);
  }

  public HasComponent(typeName: string): boolean {
    let found: boolean = false;
    this._components.forEach(component => {
      if (found) return;
      for (let index = 0; index < component.polymorphicTypes.length; index++) {
        const element = component.polymorphicTypes[index];
        if (element == typeName) {
          found = true;
        }
      }
    });
    return found;
  }

  public GetComponent<T extends Component>(typeName: string): T | undefined {
    let found: boolean;
    let returnComponent: T | undefined;
    this._components.forEach(component => {
      if (found) return;
      for (let index = 0; index < component.polymorphicTypes.length; index++) {
        const element = component.polymorphicTypes[index];
        if (element == typeName) {
          found = true;
          returnComponent = component as T;
        }
      }
    });
    return returnComponent;
  }

  public GetComponents<T extends Component>(typeName: string): T[] {
    let returnComponents: T[] = [];
    this._components.forEach(component => {
      for (let index = 0; index < component.polymorphicTypes.length; index++) {
        const element = component.polymorphicTypes[index];
        if (element == typeName) {
          returnComponents.push(component as T);
        }
      }
    });
    return returnComponents;
  }

  public Clone():GameObject{
    let clone = new GameObject("dunno");
    let components = this._components;
    for(let i = 0; i < components.length; i++){
      //clone.AddComponent(components[i].Clone());
    }
    return clone;
  }
}
